review_content:
Este un telefon ok, dimensiuni foarte bune pentru buzunar.
Ce mi-a placut la telefon: 
- ecran oled;
- constructie compacta, poate fi folosit cu o singura mana;
- camere;
- performanta si software;
Ce nu mi-a placut:
- sunetul, ma asteptam sa se auda ca XR/11 cu mai mult bass dar se aude ca un 8;
- bateria se descarca foarte rapid, minim 2 incarcari pe zi, cu bateria sub 99% cred ca va fi nevoie de 3-4 incarcari zilnice si mi se pare jalnic sa platesti o suma destul de mare pe un telefon ce nu tine macar o zi, ma voi intoarce la iPhone 11.

